export class LinksPlugin {
    constructor() {
        this.id = "links";
    }
    async getPlugin(container) {
        const { LinkInstance } = await import("./LinkInstance.js");
        return new LinkInstance(container);
    }
    loadOptions() {
    }
    needsPlugin() {
        return true;
    }
}
